import React, { useEffect } from "react";
import "./App.css";

function App() {
  const recipeUrl = "https://www.allrecipes.com/recipe/16952/the-best-banana-bread/"

  useEffect(() => {
    console.log(JSON.stringify({ recipe_url: recipeUrl }))
    // Using fetch to fetch the api from flask server it will be redirected to proxy
    fetch("/data", {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ recipe_url: recipeUrl }),
    })
    .then((res) =>
        res.json().then((data) => {
          console.log(data);
        })
    );
}, []);

  return (
      <div className="App">
          <header className="App-header">
              <h1>Recipe Saver</h1>

          </header>
      </div>
  );
}

export default App;
